import React from 'react';

import FirstComponent from "./FirstComponent.js";
import './CustomListing.css'


const CustomListing = props => {
    {props.items.length === 0 ? (<p>No data found!!!</p>) :  FilterHandler.map(expense => <FirstComponent key={expense.id} title= {expense.title} amount={expense.amount} date={expense.date} />)}
}



export default CustomListing;
